webpackJsonp([0xc9de82f6b424],{5354:function(e,t){e.exports={data:{post:{html:'<p>It\'s I Love Manila Month again at Userland, so I posted my <a href="http://discuss.2020hindsight.org/discuss/msgReader$2316">3 wishes</a> at <a href="http://www.2020hindsight.org/">2020</a>, since Susan was <a href="http://www.2020hindsight.org/2001/10/04.html">wishing today</a>.</p>\n<p>Chicken programming: Via SWR  <a href="http://god404.net/wiesentiger/archives/00000029.htm">Programming languages with chicken</a>. And PerlMonks <a href="http://perlmonks.org/index.pl?node_id=116627&lastnode_id=131">Perl Poetry: my @chickens</a>. </p>\n<p>Here\'s an article just to annoy Mama: Seattle Times: <a href="http://seattletimes.nwsource.com/html/nationworld/134347570_woman29.html">Women\'s suffrage called \'mistake\'</a></p>\n<p><a href="http://www.schockwellenreiter.de/">SWR</a>: Berlin Wall Memorial Bernauer Strasse (<a href="http://www.ernst-reuter-oberschule.de/mauer1.htm">German</a> | <a href="http://translate.google.com/translate?hl=en&sl=de&u=http://www.ernst-reuter-oberschule.de/mauer1.htm">Google translation</a>). A school photo project.</p>',fields:{title:"Yet Another Monday",date:"04 Oct 2001",url:"https://papascott.de/2001-10-04-yet-another-monday/"}}},pathContext:{slug:"/2001-10-04-yet-another-monday/",prev:{fields:{title:"Holiday",date:"03 Oct 2001",slug:"/2001-10-03-holiday/"}},next:{fields:{title:"The No-Way Web",date:"08 Oct 2001",slug:"/2001-10-08-the-no-way-web/"}}}}}});
